import React, { Component } from 'react';

export class OutcomeItem extends Component {
	render() {
		const { outcome, theKey } = this.props;

		return (
			<div className="row">
				<div className="col-2">{theKey}</div>
				<div className="col-8"></div>
			</div>
		);
	}
}

export default OutcomeItem;
